module.exports = "<!DOCTYPE html>\n<html lang=\"en\">\n   <head>\n      <title>Register with Us</title>\n      <!--meta tags -->\n      <meta charset=\"UTF-8\">\n      <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n      <meta name=\"keywords\" content=\"Leccy Responsive web template, Bootstrap Web Templates, Flat Web Templates, Android Compatible web template, \n         Smartphone Compatible web template, free webdesigns for Nokia, Samsung, LG, SonyEricsson, Motorola web design\" />\n      <script>\n         addEventListener(\"load\", function () {\n           setTimeout(hideURLbar, 0);\n         }, false);\n         \n         function hideURLbar() {\n           window.scrollTo(0, 1);\n         }\n      </script>\n      <!--booststrap css-->\n      <link href=\"../../assets/css/bootstrap.min.css\" rel=\"stylesheet\" type=\"text/css\" media=\"all\">\n      <!-- font-awesome icons -->\n      <link href=\"../../assets/css/font-awesome.css\" rel=\"stylesheet\">\n      <!-- For Clients slider -->\n      <link rel=\"stylesheet\" href=\"../../assets/css/flexslider.css\" type=\"text/css\" media=\"all\" />\n      <!-- //For clients slider -->\n      <link href=\"../../assets/css/lsb.css\" rel=\"stylesheet\" type=\"text/css\">\n      <!--gallery lsb lightbox-->\n      <!--stylesheets-->\n      <link href=\"../../assets/css/style.css\" rel='stylesheet' type='text/css' media=\"all\">\n      <!--//stylesheets-->\n      <link href=\"//fonts.googleapis.com/css?family=Montserrat:300,400,500\" rel=\"stylesheet\">\n   </head>\n   <body>\n     <div style=\"padding-right: 0px !important;padding-left: 0px !important\" class=\"container-fluid\">\n     <div class=\"header-outs\" id=\"home\">\n         <div class=\"header-bar\">\n            <app-navbar></app-navbar>\n            <div style=\"text-align:center\" class=\"hedder-up\">\n               <h1 style=\"text-align:center;margin-left:40%\"><a class=\"navbar-brand\">TRAVEL DESK<br><span class=\"fa fa-lightbulb-o\" aria-hidden=\"true\"></span>\n               \n              </a></h1>\n            </div>\n         </div>\n         <!-- //Navigation -->\n         <!-- Slideshow 4 -->\n         <div class=\"slider\">\n            <div class=\"callbacks_container\">\n               <ul class=\"rslides\" id=\"slider4\">\n                  <li>\n                     <div class=\"slider-img serveban\">\n                        <div class=\"container\">\n                     </div>\n                     </div>\n                  </li>\n                 \n               </ul>\n            </div>\n           \n         </div>\n         <div class=\"clearfix\"></div>\n      </div>\n<div style=\"padding-right:15px;padding-left:15px\" class=\"about\" id=\"about\">\n<div class=\"container-fluid\">\n <div class=\"row\">        \n    <div class=\"col-lg-12\" style=\"text-align:center\">\n     <h2 style=\"text-align:center;font-size:330%;\">\n        <strong>   <br>Travel Desk<br></strong>\n      </h2>\n      </div>\n<div  class=\"row info-sub-w4\">\n <p style=\"text-align:justify;padding-right:15px;padding-left:15px;\"> It is better to travel well, than to arrive!! Travelling is one of the activities in our day to day lives. Let it be a small or medium or big work of us, irrespective of the time, season, we always wants to go for distances to complete our work in a successful way. Sometimes travelling is best thing to get Relax and to enjoy with family & Friends.<br>\n  </p>\n  <p style=\"padding-right:15px;padding-left:15px;\">What are the best ways to travel & what are the best dealings/ Discounts of travel packages? Bus, Train, Flight are the major three ways to travel. So at Republic centre, people can avail the online ticket booing service for their travelling. SME Travel is one of the package that is provided at Republic centre, which is a domestic air travel package having 15 round trips and a 2 nights continuous staying in a 3 star hotel for only one time.Not only travelling but also online ticket booking for Movies can be done at Republic centre.</p>\n</div>\n<div class=\"row\">\n  <div class=\"col-lg-12\">\n<table style=\"font-size:200%;text-align:justify;margin-left:-2%;font-family:'Montserrat';color: #7d7979;\" >\n  <tr>\n    <td>1.Bus Tickets</td>\n    </tr>\n    <tr><td>2.Train Tickets</td></tr>\n    <tr><td>3.Flight Tickets</td></tr>\n    <tr><td>4.Movie Tickets</td><tr>\n    <tr><td>5. Temporary Permit Fee</td><tr> \n    <tr><td>6.Hotel Booking</td><tr>\n    <tr><td>7.SME Travel</td><tr>\n  \n</table>\n</div>\n</div>\n<div class='row'>\n<h2 style=\"margin-top:2%;font-size:250%;padding-right:15px;padding-left:15px;\"> <strong>   <br>BUS TICKETS:<br></strong></h2>\n<p style=\"text-align:justify;font-size:200%;margin-top:1%;padding-right:15px;padding-left:15px;color: #7d7979;\">It means providing travel services (includes bus, trains, flights ticket booking) not only to corporate clients, group of people but also to individuals. Travel Desk helps corporate as well as individuals in not only booking their Travel tickets for Bus, Train, Flight, but also helps in Hotel Booking. Through Travel Desk the cost effectiveness will be much less compared to personal booking of tickets. Through Travel Desk people can avoid long waiting to purchase tickets.</p><br>\n<p style=\"text-align:justify;font-size:200%;margin-top:1%;padding-right:15px;padding-left:15px;color: #7d7979;\">There are many ways of transportation around the world.Bus is a easy means of transportation. Buses are designed to carry a certain number of passengers. (e.g. 60-70).Buses are still a very viable means of transportation and the demand for them is still very strong.</p><br>\n\n</div>\n<div class=\"row\">\n<h2 style=\"margin-top:2%;font-size:250%;padding-right:15px;padding-left:15px;\"> <strong>   <br>TRAIN TICKETS:<br></strong></h2>\n<p style=\"text-align:justify;font-size:200%;margin-top:1%;padding-right:15px;padding-left:15px;color: #7d7979;\">Railways in India are not just a means of transport. Over the years, this mode of travel weaved itself into the history of Indian heritage and culture. A train is a form of transportation consisting of a series of connected vehicles that usually run along a rail track to transport passengers as well as cargo. Train fares are economical when compared to flight travel. Hence, people prefer train journey more. If you look to have a more sophisticated journey, you might have an a/c compartment booked for you to make your train journey more comfortable.\n    Stay connected in train journey unlike in a journey by flight. You can look through the window and enjoy what nature has in store and how beautiful the landscapes are in between cities. Bus journey could offer you this but not with the comfort a train journey could provide.\n    Trains offer the best to every traveler, as the rates are economical and the journey comfortable. Trains give you an opportunity to interact with more people and you feel a sense of belonging as train journey is always near to the hearts of people. Trains are comfortable for all ages and all wallets.\n    With online booking, reservation is made much easier, more and more people prefer traveling by train. It is evident from statistics that e-booking makes a heavy contribution to online travel in India.</p> \n</div>\n<div class=\"row\">\n<h2 style=\"margin-top:2%;font-size:250%;padding-right:15px;padding-left:15px;\"> <strong>   <br>FLIGHT TICKETS:<br></strong></h2>\n<p style=\"text-align:justify;font-size:200%;margin-top:1%;padding-right:15px;padding-left:15px;color: #7d7979;\">Costliest transport service when compared to Bus, Train, any other Transportation. For longer distances people try to choose this transportation service. Flight travel is the most convenient and easy way to travel.\n\n    Flight travel is a unique experience where people reach their destination within few hours. Flight travel covers the miles with ease and comfort. Flight Travel is the most convenient and comfortable way. Air travel takes lesser time than train is a no-brainer. Especially in today's world, where the concept of luxury, time has been truncated to say the least.<br>\n    \n    OPTIMIZATION OF TIME AND MONEY<br>\n    With new government schemes like UDAAN, that facilitates travel at Rs 2500 for an hour, with a promise of greater comfort and lesser time, for the same price, it is only natural for people to opt for flights.<br><br>\n    \n    HYGIENE<br>\n    This stands out as a major point of comparison. There's no doubt that flight is way more hygienic than our trains--be it the food or restrooms.<br><br>\n    \n    BETTER SERVICES OFFERED BY AIRLINES<br>\n    Yes, it is that one button on the top of your seat in a flight that makes the difference. Flight attendants at least try their best to cater to your needs.<br>\n    \n    We book flight tickets through Make My Trip.</p>\n</div>\n<div class=\"row\">\n<h2 style=\"margin-top:2%;font-size:220%;padding-right:15px;padding-left:15px;\"> <strong>   <br>MOVIE TICKETS:<br></strong></h2>\n<p style=\"text-align:justify;font-size:200%;margin-top:1%;padding-right:15px;padding-left:15px;color: #7d7979;\">Movies are a type of visual communication which uses moving pictures and sound to tell stories or convey about something or some message that may be scripted or a real-life incident. People in every part of the world watch movies as a type of entertainment, a way to have fun. For some people like comedy movies, some people like romantic movies, some people like action movies, some like tragic movies etc.\n    Most movies are made so that they can be shown on big screens at a movie theatre and at home. After movies are shown on movie screens for a period of weeks or months, they may be marketed through several other media. Most of the times People prefer to watch movies along with their families or friends in theatre only. Where they can lot of fun and enjoyment when compared to watch the movie alone at home in a TV, Laptop or Mobile Phone.<br>\n    In republic centre, People can also be having online ticket booking for movies also. They can book N number of tickets at a time. At Republic centre, This online ticket booking can be done through Book My Show.</p>\n</div>\n<div class=\"row\">\n<h2 style=\"margin-top:2%;font-size:220%;padding-right:15px;padding-left:15px;\"> <strong>   <br>HOTEL BOOKING:<br></strong></h2>\n<p style=\"text-align:justify;font-size:200%;margin-top:1%; padding-right:15px;padding-left:15px;color: #7d7979;\">Whenever we are going out of our town/city, accommodation plays a major role, because as we are going to a known/unknown place it is always difficult to find a place to stay. Many of the people prefer to stay in Hotels until their work get done. At republic centre people can avail online ticket booking for best Hotels at best price so that people need not to worry about their accommodation. This can be done through Make My Trip. Booking Hotel Room not only in India Hotels, but also hotels in other countries also.</p>\n</div>   \n<div class=\"row\">\n<h2 style=\"margin-top:2%;font-size:220%;padding-right:15px;padding-left:15px;\"> <strong>   <br>AIRTEL MONEY:<br></strong></h2>\n<p style=\"text-align:justify;font-size:200%;margin-top:1%;padding-right:15px;padding-left:15px;color: #7d7979;\">Airtel Money is an account on your phone, in which you can load money and then use it for a host of service.You can send money, pay bills and recharge, directly from your mobile. You can send money to family and friends, recharge your prepaid mobile and digital TV, pay mobile / utility bills, book movie tickets, pay for your shopping (both at shops & online) and much more with Airtel Money.</p>\n</div>\n<div class=\"row\">\n<h2 style=\"margin-top:2%;font-size:220%;padding-right:15px;padding-left:15px;\"> <strong>   <br>SME TRAVEL:<br></strong></h2>\n<p style=\"text-align:justify;font-size:200%;margin-top:1%;padding-right:15px;padding-left:15px;color: #7d7979;\">Small and Medium entrepreneur Travel. There are so many people who travel frequently within India. SME Travel is a service in which people can get Air Travel (Domestic) Package of 15 round trips(to and fro) and a continuous 2 nights stay in a three-star hotel per Annum at Just Rs/- 49,999. At Republic centre this package is being provided for all kinds of people who want to travel within the country.They have to book for this package One week Before.</p>\n</div>\n</div>\n              \n         \n            <br><br><br>\n       \n         </div>\n      </div>\n      <!--//about\" -->\n    \n      <!-- <div class=\"row\" style=\"margin-top:4%\">\n        \n      <div  class=\"col-lg-4 \">\n         <div  id=\"centered\">     <strong><h2>ECommerce Sales</h2></strong><br> “Ecommerce Sales” is ISH’s Consumer goods sale enabling platform. Here people may purchase various things such as Food, Clothes, Gadgets etc. Since, there are no retailers and distributors involved, we sell these at a lesser rate as compared to the market price of the products.\n         </div>\n             \n             <img   id=\"card\" src=\"../../assets/images/SERVE/E-commerce.jpg\" width=\"100%\" height=\"490vw\" alt=\" \" class=\"img-responsive\" />\n             <br><br>\n           </div>\n          \n          <div class=\"col-lg-4\">\n             <div id=\"centered\">     <strong><h2>E-Challan </h2></strong><br><p> Technology has intersected with our lives to make it more easy. Standing in the queues is an old story meant to be forgotten. We have make it easier for you.\n                    Police e-Challan is an invoice or receipt issued by the police to traffic offender as a notice for breaking the rule.                  \n            <br><br>  \n            </div>\n           <img id=\"card\" src=\"../../assets/images/SERVE/unnamed.jpg\" width=\"100%\" height=\"490vw\" alt=\" \" class=\"img-responsive\" />\n          </div>\n          <div class=\"col-lg-4\">\n\n            <a id=\"centered\">\n               <strong><h2>Tax Payments</h2></strong><br>\n               Our government asks for a certain percentage of your earning or profit and further invests it in infrastructure and other public services. It is important for us to pay these taxes so that our country prospers with us. Here at ISH, we support the taxes and provide you with an online tax paying platform.\n\n</a>\n           <img id=\"card\" src=\"../../assets/images/SERVE/unnamed (1).jpg\" width=\"100%\" height=\"490vw\" alt=\" \" class=\"img-responsive\" />\n       <br><br>\n          </div>\n       <div class=\"col-lg-4\">\n         <a id=\"centered\"><strong><h2>Ticketing</h2></strong><br>Plan your activities and travel beforehand. The initial step to every plan is buying tickets. Why to stand in queues to get your tickets done or why to login into sites that are slow for your fast moving life?</a>\n         <img id=\"card\" src=\"../../assets/images/SERVE/Ticketing.jpg\" width=\"100%\" height=\"490vw\" alt=\" \" class=\"img-responsive\" /> \n     </div>\n     <div class=\"col-lg-4\">\n      <a id=\"centered\"><strong><h2>Aadhar</h2></strong><br>Aadhar has become a “mandatory” identity proof authorized by Government of India for unique identification and authorization of each citizen. It is required for appearing for any government organized exam, a government post etc. Even private sector finds it a responsible identification method. \n      </a>\n      <img id=\"card\" src=\"../../assets/images/SERVE/unnamed (1).jpg\" width=\"100%\" height=\"490vw\" alt=\" \" class=\"img-responsive\" />\n  </div>\n      \n          \n          \n          <div class=\"col-lg-4\">\n            <a id=\"centered\"><strong><h2>Isurance </h2></strong><br>Insurance is a bullet proof jacket against the bad times which may or may not hit a person. It is a financial envelope against unforeseen events such as accident, health issue, rotten crop or in some cases death.</a>\n            <img id=\"card\" src=\"../../assets/images/SERVE/insurance.jpg\"width=\"100%\" height=\"490vw\" alt=\" \" class=\"img-responsive\" />\n     <br><br>\n        </div> -->\n            \n                \n                \n                <!-- <div class=\"col-lg-4\">\n                        <a id=\"centered\"><strong><h2>Pension</h2></strong><br>It is usually a small amount provided by the central/state government to old, pregnant or disabled.\n                            There are four schemes in relation to this:\n                             >   Sr. Citizen / State Old Age Pension: It is provided by the state/central government to the retired, widows or disabled\n                            >     ANC Pension: It is provided to the pregnant women who are at a loss in terms of wages while they are pregnant.\n                     \n                            </a>\n                        <img id=\"card\" src=\"../../assets/images/SERVE/unnamed (2).jpg\" width=\"100%\" height=\"490vw\" alt=\" \" class=\"img-responsive\" />\n                  <br><br>\n                    </div>\n                        \n                                 <div class=\"col-lg-4\">\n                                    <a id=\"centered\"><strong><h2>Dth services </h2></strong><br>Pay for your digital satellite services i.e. for your set up box and continue being uninterruptedly entertained.  No need to leave your house to get your dish recharge done.  Ex: Airtel, Videocon, Reliance, Dish TV, Sun direct, Tata Sky etc.\n                                    </a>\n                                    <img id=\"card\" src=\"../../assets/images/SERVE/dth.jpeg\" width=\"100%\" height=\"490vw\" alt=\" \" class=\"img-responsive\" />\n                                \n                                    \n                                        </div>     <div class=\"col-lg-4\">\n                                                <a id=\"centered\"><strong><h2>Mobile bills payments and recharges </h2></strong><br>Enjoy calling, messaging and 4G speed without any blockage. Pay your bills and recharge on time. We make online mobile recharge and bill payments simple and safe for you</a>\n                                                <img id=\"card\" src=\"../../assets/images/SERVE/bill-payments.jpg\" width=\"100%\" height=\"490vw\" alt=\" \" class=\"img-responsive\" />\n                                            </div>\n                                            <div class=\"col-lg-4\">\n                                                    <a id=\"centered\"><strong><h2>Utility bills</h2></strong><br>Electricity, water and gas are necessities in today’s life. Forget standing in lines to pay for these bills! PAY for electricity, gas, water, Subscription, Broadband and Landline on ISH’s portal. Discover a unique and single solution to all your bill payments.</a>\n                                                    <img id=\"card\" src=\"./../assets/images/SERVE/bill-payments.jpg\" width=\"100%\" height=\"490vw\" alt=\" \" class=\"img-responsive\" />\n                                              \n                                            </div>\n                                                    </div> -->\n        </div>\n      <!-- //Footer --><br>\n     <app-fotter></app-fotter>\n\n      <!--js working-->\n      <script src='../../assets/js/jquery-2.2.3.min.js'></script>\n      <!--//js working-->\n      <!-- carousal service slider-->\n      <script src=\"../../assets/js/slick.js\"></script>\n      <script>\n         $(document).on('ready', function() {\n           $(\".center\").slick({\n           dots: true,\n           infinite: true,\n           centerMode: true,\n           slidesToShow: 2,\n           slidesToScroll: 2,\n           responsive: [\n             {\n               breakpoint: 768,\n               settings: {\n               arrows: true,\n               centerMode: false,\n               slidesToShow: 2\n               }\n             },\n             {\n               breakpoint: 480,\n               settings: {\n               arrows: true,\n               centerMode: false,\n               centerPadding: '40px',\n               slidesToShow: 1\n               }\n             }\n            ]\n           });\n         });\n      </script>\n      <!-- //carousal -->\n      <!--responsiveslides banner-->\n      <script src=\"../../assets/js/responsiveslides.min.js\"></script>\n      <script>\n         // You can also use \"$(window).load(function() {\"\n         $(function () {\n           // Slideshow 4\n           $(\"#slider4\").responsiveSlides({\n             auto: true,\n             pager:true,\n             nav: false,\n             speed: 900,\n             namespace: \"callbacks\",\n             before: function () {\n               $('.events').append(\"<li>before event fired.</li>\");\n             },\n             after: function () {\n               $('.events').append(\"<li>after event fired.</li>\");\n             }\n           });\n         \n         });\n      </script>\n      <!--// responsiveslides banner-->\t  \n      <!--About OnScroll-Number-Increase-JavaScript -->\n      <script src=\"../../assets/js/jquery.waypoints.min.js\"></script>\n      <script src=\"../../assets/js/jquery.countup.js\"></script>\n      <script>\n         $('.counter').countUp();\n      </script>\n      <!-- //OnScroll-Number-Increase-JavaScript -->\n      <!-- clients FlexSlider-JavaScript -->\n      <script defer src=\"../../assets/js/jquery.flexslider.js\"></script>\n      <script>\n         $(window).load(function(){\n         $('.flexslider').flexslider({\n           animation: \"slide\",\n           start: function(slider){\n             $('body').removeClass('loading');\n           }\n         });\n         });\n      </script>\n      <!-- //clients FlexSlider-JavaScript -->\n      <!-- gallery-lightbox -->  \n      <script src=\"../../assets/js/lsb.min.js\"></script>\n      <script>\n         $(window).load(function() {\n             $.fn.lightspeedBox();\n           });\n      </script> \n      <!-- //gallery-lightbox -->\n      <!-- start-smoth-scrolling -->\n      <script src=\"../../assets/js/move-top.js\"></script>\n      <script src=\"../../assets/js/easing.js\"></script>\n      <script>\n         jQuery(document).ready(function ($) {\n           $(\".scroll\").click(function (event) {\n             event.preventDefault();\n             $('html,body').animate({\n               scrollTop: $(this.hash).offset().top\n             }, 900);\n           });\n         });\n      </script>\n      <!-- start-smoth-scrolling -->\n      <!-- here stars scrolling icon -->\n      <script>\n         $(document).ready(function () {\n         \n           var defaults = {\n             containerID: 'toTop', // fading element id\n             containerHoverID: 'toTopHover', // fading element hover id\n             scrollSpeed: 1200,\n             easingType: 'linear'\n           };\n         \n         \n           $().UItoTop({\n             easingType: 'easeOutQuart'\n           });\n         \n         });\n      </script>\n      <!-- //here ends scrolling icon -->\n      <script src=\"http://code.jquery.com/jquery-1.11.0.min.js\"></script>\n      <!--bootstrap working-->\n      <script src=\"../../assets/js/bootstrap.min.js\"></script>\n      <!-- //bootstrap working-->\n   </body>\n</html>  "

